import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'; 
import Formlogin from './Login/form_login';
import Formregister from './Login/form_register';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/register" element={<Formregister />} /> {/* Ruta para el formulario de registro */}
        <Route path="/login" element={<Formlogin />} /> {/* Ruta para el formulario de inicio de sesión */}
        {/* Otras rutas de tu aplicación */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
